                                                                ('28d87327-8871-418a-856e-c160d94ef615'::uuid,'title:Next level persistence in Jakarta EE: Jakarta Data and Jakarta NoSQL, description:Jakarta EE 11 introduces Jakarta Data, a repository‑style API that standardizes data access across relational and NoSQL stores. This talk demystifies how it relates to JPA and Jakarta NoSQL, introduces JDQL and shows examples with Eclipse JNoSQL. Learn when to use each approach and what’s next.','{"id": "460aaa571cef41a99fa778d19bf51cc0", "room": "Room 8", "title": "Next level persistence in Jakarta EE: Jakarta Data and Jakarta NoSQL", "endsAt": 1762424700000, "category": "[Technical Session, Intermediate]", "dayIndex": 1, "speakers": "[Arjan Tijms]", "startsAt": 1762421700000, "phaseOfDay": "MORNING", "conferenceDay": "2025-11-06", "durationMinutes": 50, "endsAtLocalDateTime": "2025-11-06T11:25:00", "startsAtLocalDateTime": "2025-11-06T10:35:00"}','[-0.021136582,0.022090377,0.09928895,0.008254454,0.052470535,0.014471788,-0.038457982,0.043215185,-0.004757203,-0.043309387,0.0831804,-0.0415902,-0.023715364,-0.012999881,0.0023153096,0.018322296,0.021654693,0.0014741147,0.055720504,0.06890879,-0.024421878,0.004842574,0.031157324,0.015437359,0.01893461,-0.0055667516,-0.009897102,0.08930353,0.064339995,-0.06504651,0.007989511,-0.024704484,0.008837329,0.038104724,0.02216103,-0.02104238,0.05459008,-0.016261628,0.0062232222,-0.013706396,-0.014271609,-0.03334752,-0.0032794084,-0.0085782735,0.0126230735,0.03372433,0.026918232,-0.0041978783,0.027365692,0.044298507,-0.034737002,0.0056962795,0.04752493,0.07248847,-0.016073223,-0.008990407,0.025081294,0.07974203,-4.1811356e-05,-0.02818996,0.018699104,-0.002606747,-0.0070416024,0.054307476,-0.017403826,0.007506725,-0.006570592,-0.03184029,0.0033412285,0.0021916693,-0.021148358,0.024421878,-0.06575302,-0.017309625,0.0018281083,0.004565855,0.00082721165,0.008319218,0.017427377,0.011510312,-0.019099463,0.02498709,-0.06429289,-0.012305141,0