                                                                ('c14441d6-df71-4cb2-84c2-2c58128bd81e'::uuid,'title:From Exceptions to Rich Errors: Rethinking Error Handling in Kotlin, description:Explore how Java’s exception model works, how Kotlin evolved it and other approaches like Result, Optional and sealed hierarchies. Learn about Kotlin’s new Rich Errors model—treating errors as values integrated into the type system—and how to use it for more predictable error handling.','{"id": "e3f066108c5a45f297ef841f1d85a381", "room": "Room 5", "title": "From Exceptions to Rich Errors: Rethinking Error Handling in Kotlin", "endsAt": 1762424700000, "category": "[Technical Session, Intermediate]", "dayIndex": 1, "speakers": "[Michail Zarečenskij]", "startsAt": 1762421700000, "phaseOfDay": "MORNING", "conferenceDay": "2025-11-06", "durationMinutes": 50, "endsAtLocalDateTime": "2025-11-06T11:25:00", "startsAtLocalDateTime": "2025-11-06T10:35:00"}','[-0.037883654,0.030462416,0.0067674625,0.02480814,0.022699567,-0.009276548,-0.04636507,0.019165643,0.003628161,0.022334393,0.00733878,-0.038778916,0.01467756,0.05682548,0.0050328956,-0.0031834757,0.019683952,-0.002338279,0.0013068153,0.031287,0.0058928165,-0.030580213,0.067144535,0.021710068,0.0020290609,-0.012745682,-0.025326448,0.019389458,0.052773252,-0.006484749,-0.005601268,-0.021486253,-0.0042583775,-0.04330234,0.024030676,-0.006390511,0.016444521,-0.01610291,-0.013546705,-0.016232487,-0.004090516,-0.0069559384,0.0057779644,0.01877691,-0.038920272,0.07345848,0.059841096,0.008669891,-0.013487807,0.0015770132,-0.04118198,-0.04636507,0.05093561,-0.004535201,-0.023300333,-0.014347727,-0.010701897,0.03616381,-0.032088023,0.008557984,0.029684953,-0.019118523,-0.052679013,-0.002255821,-0.071950674,-0.02433695,-0.07312865,-0.03522143,0.0003193415,0.06573097,0.025915436,-0.028671896,-0.03123988,0.015914433,-0.022393292,-0.013817639,0.0357633,0.028530538,0.06898218,-0.011567708,0.024289832,0.013523146,-0.001768434,0.0010756379,-0.02