                                                                ('bf7d5e81-ef09-4f0c-971d-b62b34cbdef6'::uuid,'title:Java Beyond Frameworks: Avoiding Lock-In with Agnostic Design, description:Modern frameworks like Spring Boot speed development but create lock‑in and bloat. This talk advocates a layered, framework‑agnostic approach: decouple business logic with JSR standards, replace framework annotations and integrate cloud services without coupling. Learn patterns, trade‑offs and when to adopt this approach.','{"id": "e39dd5031102444692b390c0b52629fa", "room": "Room 5", "title": "Java Beyond Frameworks: Avoiding Lock-In with Agnostic Design", "endsAt": 1762428600000, "category": "[Technical Session, Intermediate]", "dayIndex": 1, "speakers": "[Rijo Sam]", "startsAt": 1762425600000, "phaseOfDay": "MORNING", "conferenceDay": "2025-11-06", "durationMinutes": 50, "endsAtLocalDateTime": "2025-11-06T12:30:00", "startsAtLocalDateTime": "2025-11-06T11:40:00"}','[-0.016546965,0.064537026,0.03732417,-0.025368571,0.044623926,-0.004920239,-0.042431418,0.0070031187,0.026903326,0.0017298219,0.04761605,-0.029869655,-0.027728738,0.02343401,0.0006811275,0.012381204,0.0055070566,-0.050814528,0.013735399,0.035183255,0.016314816,0.0018007559,0.02953433,0.03373878,0.0069644274,-0.02059665,-0.012677837,0.041167505,0.018313864,-0.037195202,0.011813733,-0.03224272,0.011130187,-0.006635552,0.021151224,-0.031907395,0.021680005,-0.034693167,0.046300545,0.0066548972,-0.0086023575,-0.06660056,0.0128197055,0.029070036,0.048338287,0.0469454,0.03451261,0.007074053,-0.019680956,0.04983435,-0.047461282,-0.04268936,0.058655955,0.021293093,-0.04336001,0.007112744,0.011375232,0.033996724,0.010781965,0.061235372,0.065207675,-0.01674042,-0.016714627,0.04286992,-0.028089857,-0.016624346,-0.04150283,-0.02741921,-0.022892332,0.0017201491,0.02059665,-0.027599769,-0.059997253,0.019539088,-0.019474603,0.0132968975,-0.01661145,0.010137111,0.023124479,0.012652043,-0.031649455,0.020248428,0.006425974,-0.0061906