                                                                ('e7c6d847-a398-489c-a06b-32070e1fd407'::uuid,'title:Stop Chasing Unicorns and Rainbows: The Dangers of Survivorship Bias in Tech, description:Survivorship bias leads us to focus on unicorn successes and ignore countless failures. This talk examines how luck and external factors influence success, how biased narratives distort reality and offers strategies to maintain a realistic perspective in tech.','{"id": "ef06cb15d4a54b5498de90a2478d1822", "room": "Room 8", "title": "Stop Chasing Unicorns and Rainbows: The Dangers of Survivorship Bias in Tech", "endsAt": 1762445400000, "category": "[Byte size (16 min), Beginner]", "dayIndex": 1, "speakers": "[Louëlla Creemers]", "startsAt": 1762444500000, "phaseOfDay": "AFTERNOON", "conferenceDay": "2025-11-06", "durationMinutes": 15, "endsAtLocalDateTime": "2025-11-06T17:10:00", "startsAtLocalDateTime": "2025-11-06T16:55:00"}','[0.033521917,0.016468616,0.010635691,0.022747016,0.016092747,-0.010475599,-0.010851468,0.03803234,-0.012299258,0.04323882,0.011463994,-0.014255167,0.005725037,-0.0061739907,-0.0034489431,0.01717859,-0.00014388723,-0.027869966,-0.021939592,0.029150704,-0.0013399022,0.018153064,0.027911728,0.039424445,0.017777195,0.042570606,0.0049872203,0.06086288,0.04323882,0.010016204,0.031294547,-0.037169233,-0.039647184,-0.02161941,0.017248195,0.05941509,0.02004633,0.014895536,0.0124663105,0.017721511,0.025392016,-0.043907028,0.04916919,0.04624577,0.064593725,0.039313078,0.01822267,-0.021828225,0.006093945,0.021661172,-0.050310716,-0.002780732,0.012229653,0.056324616,-0.038951132,-0.034691285,0.0102459015,0.046774767,-0.049893085,-0.02242683,0.06320162,0.0055510234,0.06086288,-0.016371168,-0.028733071,-0.008067255,-0.037002183,-0.011122928,-0.015967458,-0.018682064,0.05362393,0.0029564854,-0.043489397,0.08224563,0.03502539,0.012389745,-0.02214841,0.044909347,0.01548022,-0.03792097,-0.004628753,0.00085919054,0.022398988,0.0021020803,-0.024306174,0.0077609