                                                                ('b94f7086-37c3-4973-b3ee-236fc85363e4'::uuid,'title:The Wait is Over: Foreign Function & Memory (FFM) API brings modern Java to the Raspberry Pi, description:Pi4J has enabled Java to control Raspberry Pi electronics since 2012. With the FFM API finalized in Java 22 and Java 25, integrating native code is easier and faster. Learn how the new FFM‑based implementation simplifies support, reduces overhead, and enables high‑performance demos controlling LEDs, buttons and sensors.','{"id": "f63bdda067824676b3000a8bf0430548", "room": "Room 3", "title": "The Wait is Over: Foreign Function & Memory (FFM) API brings modern Java to the Raspberry Pi", "endsAt": 1762447500000, "category": "[Technical Session, Beginner]", "dayIndex": 1, "speakers": "[Frank Delporte]", "startsAt": 1762444500000, "phaseOfDay": "AFTERNOON", "conferenceDay": "2025-11-06", "durationMinutes": 50, "endsAtLocalDateTime": "2025-11-06T17:45:00", "startsAtLocalDateTime": "2025-11-06T16:55:00"}','[-0.007733182,0.018825863,0.016315747,-0.020359822,0.010648972,-0.02839726,-0.027890166,0.0031011961,0.026318174,-0.022286778,0.06257539,-0.026495658,-0.07261585,0.00015925919,0.0055558477,-0.021196526,-0.0144014675,-0.037601013,0.015301559,0.03973081,-0.0123604145,-0.025443437,0.009330528,-0.016518584,0.022603711,-0.038995523,-0.040035065,0.021424718,-0.011827965,-0.040643577,-0.016810164,-0.040744998,-0.019700598,-0.062271133,0.019840049,-0.024632087,0.00927348,-0.046576574,-0.001130661,-0.013121055,-0.060496304,0.009622107,-0.035674058,0.011390598,0.0014784957,0.03197227,0.0015917995,-0.016265037,-0.00032188577,0.036206506,-0.0061580217,0.010572908,-0.00059702387,0.06511086,-0.012366753,0.06166262,0.0252406,0.01596078,0.013374602,0.036257215,0.020106275,0.002242306,-0.011967417,-0.030146733,-0.036967147,0.059583534,-0.008810757,0.0011694854,0.050024815,-0.009755219,-0.0095587205,0.015238172,0.0024213735,-0.03255543,-0.0125252195,-0.0021709958,0.0085